import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar/Navbar';

const Home = () => {
  const [productList, setProductList] = useState([]);

  useEffect(() => {
    fetch('./api/avo')
      .then((response) => response.json())
      .then(({ data, length }) => setProductList(data, length));
  }, []);

  return (
    <div>
      <Navbar />
      <h1>Hola Platzi!</h1>
    </div>
  );
};

export default Home;
